import React from 'react'
import styled from 'styled-components'
import sculture from '../images/sculture.png'

function Hero() {
    return (
        <Heroo>
            <HeroContainer>
                <div className="text">
                    <h1><span>S</span> cultures</h1>
                    <ul>
                        <li>1</li>
                        <li>2</li>
                        <li>3</li>
                    </ul>
                </div>
                <div className="image">
                    <img src={sculture} alt="" srcset="" />
                </div>
            </HeroContainer>
        </Heroo>
    )
}

export default Hero

const Heroo = styled.div`
min-height: 70vh;
width: 100%;

display: flex;
justify-content: center;
align-items: center;
`
const HeroContainer = styled.div`
width: 80%;
height: fit-content;

display: flex;


.text {
    width: 50%;
    display: flex;
justify-content: center;
align-items: center;
font-size: 40px;
letter-spacing: 2px;

span {
    color: #DAA520;
    font-size: 50px;
}

}
.image {
    width: 40%;

    img {
        width: 100%;
    }
}

ul{
    position: absolute;
    bottom: 0;
    left: 25%;
    display: flex;
    list-style: none;
    font-weight: 100;

}
`
